import React, { Component } from "react";
import axios from "axios";

export default class UploadDocuments4 extends Component {
  state = {
    mastersTranscriptInput: null,
  };

  //If applicant is working the permission letter is needed from the applicant
  applicationHandle = (event) => {
    const target = event.target;
    if (target.value === "PhD") {
      this.setState({
        mastersTranscriptInput: (
          <tr>
            <td>
              <p>Masters Transcript</p>
            </td>

            <td>
              <form>
                <div class="form-group rounded">
                  <label for="file-upload" class="custom-file-upload">
                    Choose a file
                  </label>
                  <input
                    type="file"
                    onChange={this.upload}
                    name="mastersTranscript"
                    id="file-upload"
                  />
                </div>
              </form>
            </td>
          </tr>
        ),
      });
    } else {
      this.setState({ mastersTranscriptInput: null });
    }
  };





//Handles Uploading the files
  upload = async (event) => {
    const target = event.target;
    const name = target.name;
    const file = target.files[0];

    await axios({
      url: "http://commerchant.herokuapp.com/documents/upload/",
      method: "POST",
      headers: {
        // Authorization: window.localStorage.getItem("token")
        Authorization:
          "Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9..Y9Kt_w2oQkuVHBpcC2jbBK8SzYqXAIPRGuVzKGJtH34",
      },
      body: {
        title: name,
        document: file,
      },
    })
      .then((response) => console.log(response.success))
      .catch(() => console.log("Upload Başarısız"));
  };

  render() {
    return (
      <div class="wrapper">
        <div class="content">
            	<div class ="container-fluid">
            		<div class="row">
            			<div class="col-md-8">
            				<div class="card">

            					<div class="card-header">
                      <h4> Step 2 / 4</h4>
            						<h4 class="card-title"> 
            							<center>
            								Application
            							</center>
            						</h4> 
            					</div>

            					<div class="card-body">
            						<div class="table-full-width">
            							<table class="table">
            								<tbody class="add-remove">


                                                <tr class="masters-transcript-after">
                                                    <td class="col-md-8">
                                                        <p>
                                                            Which degree to apply ?
                                                        </p>
                                                    </td>

                                                    <td>
                                                        <div class="form-check form-check-inline" >
                                                            <input class="form-check-input" name="radioOptions1" type="radio" id="radio1-transcript" value="PhD"  onChange={this.applicationHandle}/> PhD
                                                            <label class="form-check-label" for="radio1"></label>
                                                        </div>

                                                        <div class="form-check form-check-inline" >
                                                            <input class="form-check-input" name="radioOptions1" type="radio" id="radio2" value="Master"  onChange={this.applicationHandle}/> Master
                                                            <label class="form-check-label" for="radio2"></label>
                                                        </div>

                                                        <div class="form-check form-check-inline" >
                                                            <input class="form-check-input" name="radioOptions1" type="radio" id="radio3" value="PhD Without Master Degree"  onChange={this.applicationHandle}/>
                                                            PhD Without Master Degree
                                                            <label class="form-check-label" for="radio3"></label>
                                                        </div>

                                                    </td>

                                                </tr>
                                                {this.state.mastersTranscriptInput}
            								</tbody>
            							</table>
            						</div> 
            					</div>

            					<div class="card-footer">

            						<div class="row float-right">
										<button type="button" class="btn btn-primary btn-block" >Next Step</button>
									</div>

            					</div>

							</div>


            			</div>



            		</div>
            	</div>
            </div>
      </div>
    );
  }
}
